import React, { useState } from 'react';

export default function SpoolWaitlist() {
  const [email, setEmail] = useState('');
  const [isSubmitted, setIsSubmitted] = useState(false);

  const handleSubmit = () => {
    if (email) {
      // Placeholder for backend integration
      console.log('Email submitted:', email);
      setIsSubmitted(true);
    }
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center px-4" style={{ backgroundColor: '#5DADE2' }}>
      {/* App Icon with Rounded Frame */}
      <div className="mb-8">
        <div className="w-32 h-32 bg-white rounded-3xl shadow-2xl flex items-center justify-center p-4">
          {/* Spool Logo */}
          <div className="relative">
            {/* Thread Spool */}
            <div className="w-16 h-20 relative">
              {/* Top of spool */}
              <div className="w-16 h-4 bg-yellow-300 rounded-full border-2 border-yellow-600 absolute top-0"></div>
              {/* Middle thread section */}
              <div className="w-14 h-12 bg-blue-400 mx-auto mt-2 relative">
                {/* Thread lines */}
                <div className="absolute inset-0 flex flex-col justify-center space-y-1">
                  <div className="h-0.5 bg-blue-500 w-full"></div>
                  <div className="h-0.5 bg-blue-500 w-full"></div>
                  <div className="h-0.5 bg-blue-500 w-full"></div>
                  <div className="h-0.5 bg-blue-500 w-full"></div>
                </div>
              </div>
              {/* Bottom of spool */}
              <div className="w-16 h-4 bg-yellow-300 rounded-full border-2 border-yellow-600 absolute bottom-0"></div>
              {/* Loose thread */}
              <div className="absolute -right-2 bottom-8 w-8 h-8">
                <svg viewBox="0 0 32 32" className="w-full h-full">
                  <path d="M2 16 Q8 8, 16 16 T30 16" stroke="#5DADE2" strokeWidth="3" fill="none" strokeLinecap="round"/>
                </svg>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* App Title */}
      <div className="text-center mb-2">
        <h1 className="text-6xl font-bold text-white tracking-wider" style={{ fontFamily: 'system-ui, -apple-system, sans-serif' }}>
          Spool
        </h1>
      </div>

      {/* Tagline */}
      <div className="text-center mb-12">
        <p className="text-2xl text-white/90 font-light italic">
          Your thread's running out.
        </p>
      </div>

      {/* Waitlist Form */}
      <div className="w-full max-w-md">
        {!isSubmitted ? (
          <div className="space-y-6">
            <div>
              <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                placeholder="Enter your email address"
                className="w-full px-6 py-4 text-lg rounded-full border-2 border-white/20 bg-white/10 text-white placeholder-white/70 focus:outline-none focus:border-white/50 focus:bg-white/20 transition-all"
              />
            </div>
            <button
              onClick={handleSubmit}
              className="w-full bg-white text-blue-500 font-semibold py-4 px-6 rounded-full text-lg hover:bg-blue-50 transition-colors shadow-lg hover:shadow-xl transform hover:-translate-y-0.5 transition-transform"
            >
              Join the Waitlist
            </button>
          </div>
        ) : (
          <div className="text-center space-y-4">
            <div className="w-16 h-16 bg-white rounded-full flex items-center justify-center mx-auto mb-4">
              <svg className="w-8 h-8 text-blue-500" fill="currentColor" viewBox="0 0 20 20">
                <path fillRule="evenodd" d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z" clipRule="evenodd" />
              </svg>
            </div>
            <h2 className="text-2xl font-semibold text-white">You're on the list!</h2>
            <p className="text-white/80">We'll let you know when Spool is ready to launch.</p>
          </div>
        )}
      </div>

      {/* Footer */}
      <div className="mt-16 text-center">
        <p className="text-white/60 text-sm">
          Coming soon â€¢ Follow the thread
        </p>
      </div>

      {/* Decorative elements */}
      <div className="absolute top-10 left-10 w-2 h-2 bg-white/20 rounded-full"></div>
      <div className="absolute top-20 right-16 w-1 h-1 bg-white/30 rounded-full"></div>
      <div className="absolute bottom-16 left-20 w-1.5 h-1.5 bg-white/25 rounded-full"></div>
      <div className="absolute bottom-32 right-12 w-2 h-2 bg-white/20 rounded-full"></div>
    </div>
  );
}
